div.div:
Определение функции - сигнатура + тело функции, являющееся исчерпывающим описанием функции.
type name(args...) { ... }
Для каждой функции определение должно быть только одно. Данное правило называется one definition rule (правило единственного определения) и является следствием особенностей работы компилятора и линковщика. Но основной причиной этого правила является отказ от ответственности за разрешение нужного вызова функции. Даже если определения функций полностью совпадают, компилятор и линковщик не производят семантический анализ и считают подобное ошибкой, чтобы не допустить неоднозначности.
Определение функции одновременно является и объявлением.
Ex. void foo() {
std::cout << std::endl;
}
void foo() { // ошибка, два определения
std::cout << std::endl;
}
